import React, {useState, useEffect} from 'react';
import Table from 'react-bootstrap/Table';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  const [error, setError] = useState(null);
  const [isLoaded, setIsLoaded] = useState(false);
  const [items, setItems] = useState([]);

  useEffect(() => {
    fetch('https://raw.githubusercontent.com/StrategicFS/Recruitment/master/data.json')
      .then(res => res.json())
      .then(
        (result) => {
          setIsLoaded(true);
          setItems(result);
        },
        (error) => {
          setIsLoaded(true);
          setError(error);
        }
      )
  }, [])

  console.log('items-->', items)

  if (error) {
    return <div>Error: {error.message}</div>;
  } else if (!isLoaded) {
    return <div>Loading...</div>;
  } else {
    return (
      <div className="App">
        <div className="banksTable">
          <Table striped bordered hover>
            <thead>
              <tr>
                <th>checkbox</th>
                <th>Creditor</th>
                <th>First Name</th>
                <th>Last Name</th>
                <th>Min Pay%</th>
                <th>Balance</th>
              </tr>
            </thead>
            <tbody>
              {items.map(item => (
                <tr id={item.id}>
                  <td>checkbox</td>
                  <td>{item.creditorName}</td>
                  <td>{item.firstName}</td>
                  <td>{item.lastName}</td>
                  <td>{item.minPaymentPercentage.toFixed(2)}%</td>
                  <td>{item.balance}</td>
                </tr>
              ))}
            </tbody>
          </Table>
        </div>
        <div className="tableButtons">
          <button>Add Debt</button>
          <button>Remove Debt</button>
        </div>
        <div className="balanceTotal">
        </div>
        <div className="rowCounts">
        </div>
      </div>
    );
  }
}

export default App;
